import React from "react";

function Post() {
  return (
    <div>
      <div className="PostContainer">
        <div className="PostimageFrame">
          <img id="1" />
        </div>
        <div className="ProfileContainer">
          <label id="profileName">Yair Gabay</label>
          <img id="2" />
        </div>
      </div>
    </div>
  );
}

export default Post;
